import React, { Component } from "react";

import MyElement from '../../components/MyElement/MyElement';
import MyElementEmpty from '../../components/MyElementEmpty/MyElementEmpty';

class MyList extends Component {
    state = {};

    componentWillMount() {
        // antes de cargar el componente
        this.setState({
            articulos: [
                {
                    titulo: 'Articulo 1',
                    texto: 'Texto de prueba numero uno',
                    fechaPublicacion: '2022-01-01',
                    imagen: 'data:image/jpeg;base64,'
                },
                {
                    titulo: 'Articulo 2',
                    texto: 'Texto de prueba numero dos',
                    fechaPublicacion: '2022-02-02',
                    imagen: 'https://esloqueveo.com/thumbnail.aspx?p_registro=146170&p=0&t=33'
                },
                {
                    titulo: 'Articulo 3',
                    texto: 'Texto de prueba numero tres',
                    fechaPublicacion: '2022-03-03',
                    imagen: 'data:image/jpeg;base64,'
                },
                {
                    titulo: 'Articulo 4',
                    texto: 'Texto de prueba numero cuatro',
                    fechaPublicacion: '2022-04-04',
                    imagen: 'data:image/jpeg;base64,'
                }
            ]
        });
    }

    componentDidMount() {
        // Una vez pintado el componente
        console.log(this.props);
    }

    componentWillUnmount() {
        // al destruir el componente (ni idea para que puede servir)
    }

    render() {
        return (
            <div className="center">
                <section id='content' className="listaElementos">
                    {
                        this.state.articulos.length > 0 ? (
                            this.state.articulos.map((articulo, i) => {
                                return (
                                    <MyElement
                                        key={i}
                                        title={articulo.titulo}
                                        text={articulo.texto}
                                        date={articulo.fechaPublicacion}
                                        image={articulo.imagen} />
                                );
                            })
                        ) : (
                            <MyElementEmpty />
                        )
                    }
                </section>
            </div>
        );
    }
}

export default MyList;